import style from "./About.module.css";

const Contacto = () =>{
    return(
        <div className={style.AboutContainer}>
            <div className={style.TituloAboutContainer}>
                <h1 className={style.TituloAbout}>Gonzalo Berdazaiz</h1>
                <h3 className={style.IntroAbout}>Industrial Engineer studying to be a Full stack developer</h3>
            </div>
            <div>
                <h2>About me...</h2>
                <p>Hi! My name is Gonzalo Berdazaiz. I'm an Industrial engineer with 6 years of experience in Management Control in two Argentinian companies. Currently, I'm studying to be a Full Stack Developer in Henry.</p>
            </div>
            <div>
                <h2>Contact</h2>
            </div>
        </div>
    )
}

export default Contacto;
